                        md={8}
                        lg={8}
                        xl={8}
                    >
                        <img src={`${API_URL} /den/Xuong-san-xuat/1.png`} alt="" />
                    </Col>
                    <Col className='section4-list-container'
                        xs={12}
                        sm={12}
